import Foundation

//counting and sliding windown
// TIme: o(n)
// space: o(m)
func maxSubarrayLengthCountingAndSlidingWindown(_ nums: [Int], _ k: Int) -> Int {
  var freqCounter = [Int: Int]()
  var start = 0
  var maxLength = 0
  var charWithFreqOverK = 0
  
  for num in nums {
    freqCounter[num, default: 0] += 1
    //maxLength = max(maxLength, end - start + 1)
    if freqCounter[num]! == k + 1 {
      charWithFreqOverK += 1
    }
    
    if charWithFreqOverK > 0 {
      freqCounter[nums[start], default: 0] -= 1
      if freqCounter[nums[start]]! == k {
        charWithFreqOverK -= 1
      }
      start += 1
    }
  }
  return nums.count - start
}

