func maxSubarrayLength(_ nums: [Int], _ k: Int) -> Int {
  var freqCounter = [Int: Int]()
  var start = 0
  var maxLength = 0
  
  for (end, num) in nums.enumerated() {
    freqCounter[num, default: 0] += 1
    
    while freqCounter[num]! > k {
      freqCounter[nums[start]]! -= 1
      start += 1
      
    }
    
    maxLength = max(maxLength, end - start + 1)
  }
  
  return maxLength
}

